function Header() {
	return (
	 <header>
		 <nav className="bg-gray-200 py-3 shadow-xl">
			 <div className="flex items-center justify-center flex-wrap mx-auto">
				 <div className="container">
					 <div className="">
						 <span className="text-md">Weather Connect</span>
					 </div>
				 </div>
			 </div>
		 </nav>
	 </header>
	);
}

export default Header;
